import React from "react";
import { Button, Container, NavDropdown, Nav, Navbar } from 'react-bootstrap';
import NavbarCollapse from "react-bootstrap/esm/NavbarCollapse";
import logo from '../../assest/Logo.png'
import './navbar.css'


const Navigation = () => {
    return (
        <Container fluid >
            <Navbar collapseOnSelect expand="lg" className="navbar">
                <Container>
                 {/* <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand> */}
                    <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                    <Navbar.Collapse id="responsive-navbar-nav" style={{justifyContent: 'left'}} >
                        <Navbar className="header_area">
                          <Nav.Link className="link">HOME  </Nav.Link>
                          <Nav.Link className="link">ABOUT </Nav.Link>
                          <Nav.Link className="link">SERVICES</Nav.Link>
                          <Nav.Link className="link">GALLERY </Nav.Link>
                          <Nav.Link className="link">CONTACTS </Nav.Link>
                        </Navbar>
                   
                    </Navbar.Collapse>
                </Container>
            </Navbar>
        </Container>
    );
}

export default Navigation;
